import { Link } from 'react-router-dom';
import logo from '../assets/images/logo.svg';


function Header() {
  return (
    <header className="header">
      <div className="logo">
        <Link to="/">
        <img src ={logo} alt="My Shopee Logo"/>
        </Link>
      </div>
    </header>
  );
}

export default Header;
